import { Link } from 'react-router-dom';

const HeadofDepartment = () => {
    return (  
        <div className = 'head-of-department'>
            <h1>Head of Department</h1>

            <div>           
                <Link to = '/SchoolOfficer'><button className = 'previous-button'>Previous</button></Link>
                <Link to = '/BabcockUniversityTeachingHospital'><button className = 'next-button'>Next</button></Link>
            </div>
        </div>
    );
}
 
export default HeadofDepartment;
